/**
 * Copyright - DocsApp
 */

import React from 'react'

import Home from './Home'
import Header from 'app/containers/Header'
import Content from 'app/containers/Content'
import Popup from 'app/containers/Popup'
import DataSource from 'config/api'

export default class Index extends React.Component {

  constructor(props) {
    super();
    this.state = {
      showUploadPopup: false,
      uploadCalledForLeadId: null
    }
  }

  componentWillMount() {
    DataSource.metaInit();
  }

  render() {
    return (
      <div>
        <Popup />
        <Ticker />
        <Header />
        <Content page={this.props.page} />
      </div>
    );
  }

}
